function renameKeys(keysMap, obj) {
  debugger;

  return Object.keys(obj).reduce((acc, key) => {
    debugger;

    const renamedObject = {
      [keysMap[key] || key]: obj[key],
    };

    debugger;

    return {
      ...acc,
      ...renamedObject,
    };
  }, {});
}

export default renameKeys;
